  const [question2, setQuestion2] = useState('');

  const handleQuestion2Change = (value) => {
    setQuestion2(value);
  }
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home handleQuestion2Change={handleQuestion2Change}/>}/>
        <Route path="/modehoice" element={<ModeChoice />}/>


      </Routes>
    </BrowserRouter>
  )
}

export default App
